import {gql} from "@apollo/react-hooks";

export const CountryQuery = gql`
    query country(code: ID!) {
        country(code: $ID) {
            name
            native
            phone
            continent{
			    code
			    name
            }
            capital
            currency
            languages{
                code
                name
            }
            emoji
        }
    }

`;
